import ""

function Row({box}) {
    return(
        <div>
            <button className={box}></button>
            <button className={box+1}></button>
            <button className={box+2}></button>
        </div>
    );
}

function Board() {
    var box = 1;
    return(
        <div className="board">
            <Row box={box} />
            <Row box={box + 3} />
            <Row box={box + 6} />
        </div>
    );
}

export default Board;
